def createDictionary():
    # reads CSV file and stores contents as a dictionary
    fileName = r"C:\Users\AlexLoStorto\PycharmProjects\pythonProject\Other\HTML\Portfolio_V2\Pages\Resources\Exam Timetable\Timetable.csv"
    with open(fileName, "r") as file:
        data = []
        for line in file:
            if any(substring in line for substring in ['UNIT', 'AM', 'PM']):
                continue

            line = line.split(",")
            line[-1] = line[-1].replace('\n', '')

            unitCode = line[0]
            subject = line[1]
            tier = line[2]
            duration = line[3]

            value = {'UnitCode': unitCode, 'Subject': subject,
                     'Tier': tier, 'Duration': duration}

            data.append(value)

    for line in data:
        print(f"{line},")


if __name__ == '__main__':
    createDictionary()
